<?php
// Database connection details
$servername = "localhost";
$username = "root";
$password = "";
$database = "maps";

// Create a connection to the database
$conn = new mysqli($servername, $username, $password, $database);

// Check the connection
if ($conn->connect_error) {
    die("Connection failed: " . $conn->connect_error);
}

if ($_SERVER["REQUEST_METHOD"] == "POST" && isset($_POST["save_border"])) {
    // Get the coordinates from the JavaScript array
    $coordinatesArray = json_encode($_POST["coordinatesArray"]);

    // Escape special characters in the coordinatesArray using mysqli_real_escape_string

    // Get other necessary data (email, creator, date & time, IP address)
    $Toda = $_POST["Toda"];
    $creator = $_POST["creator"];
    $datetime = $_POST["datetime"];
    $status = $_POST["status"];
    $ip = $_SERVER["REMOTE_ADDR"];

    // Prepare and execute an SQL INSERT statement
    $sql = "INSERT INTO ruta (Toda, Borders, Creator, DateCreated, status) VALUES (?, ?, ?, ?, ?)";
    $stmt = $conn->prepare($sql);
    $stmt->bind_param("sssss", $Toda, $coordinatesArray, $creator, $datetime, $status);
    
    if ($stmt->execute()) {
        echo '<div class="message success">Coordinates saved successfully!</div>';
    } else {
        echo '<div class="message error">Error: ' . $stmt->error . '</div>';
    }

    $stmt->close();
}

// Close the database connection
$conn->close();
